import React, { Component} from 'react';
import {
  ProfileSkills,
  ProfileComponent,
  ProfileList,
  ProfileItem,
  SpanItem,
  SpanWeb,
  Skills,
  SkillsDesc,
  Bar,
  BarTitle,
  BarPercent,
  BarParent,
  BarDivSpan,
  PSTitle,
  PSTitleSpan
} from './style.js';

class Profile extends Component {
  state = {
    infoProfile : [],
    skills : []
  }

  componentDidMount(){
    const Profile =  fetch('data.json').then(responce => {
      return responce.json()
    }).then(result => {
      return result.profile;
    });
    this.setState({
      infoProfile : Profile.info,
      skills : Profile.skills
      
    })
    
  }

   getPercent = () => {
    return ('10%')
    // console.log('percent')
  }

  getSkills = () => {
    // const inforPr = this.state.infoProfile;
    const skills = this.state.skills;


    return (
        
      <Bar>
                          <BarTitle>Bootstrap</BarTitle>
                          <BarPercent>100%</BarPercent>
                          <BarParent>
                              <BarDivSpan percent = {this.getPercent}></BarDivSpan>
                          </BarParent>
                      </Bar>
    );
  }

render(){
    return (
      <div >
        <ProfileSkills>
              <div className="container">
                  <ProfileComponent>
                      <PSTitle><PSTitleSpan>My </PSTitleSpan>Profile</PSTitle>
                      <ProfileList>
                          <ProfileItem>
                              <SpanItem>Name</SpanItem>
                              Hamza Nabil
                          </ProfileItem>
                          
                          <ProfileItem>
                              <SpanItem>Website</SpanItem>
                              <SpanWeb>www.google.com</SpanWeb>
                          </ProfileItem>
                      </ProfileList>
                  </ProfileComponent>
                  
                  <Skills>
                      <PSTitle>Some <PSTitleSpan>skills</PSTitleSpan></PSTitle>
                      <SkillsDesc>
                      Lorem ipsum dolor sit amet, consectetur adipisicing elit. Quos praesentium blanditiis esse cupiditate, omnis similique.
                      </SkillsDesc>
                      {this.getSkills()}
                  </Skills>
                  
              </div>
          </ProfileSkills>
      </div>
    );
  }
}

export default Profile;
